sys_variable_value.value:
(function execute(inputs, outputs) {
	if (inputs.status_code == "201") {
		outputs.status = "Success";
		var response = JSON.parse(inputs.response);
		outputs.contact_id = response.contactid;
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.createAContactErrorHandler(inputs, outputs);
})(inputs, outputs);

